text='GAGCCACCGCGATA'
def calcSkew(text):
    t=text[0]
    skew=[0]
    if t=='G':
        skew.append(1)
    elif t=='C':
        skew.append(-1)
    else:
        skew.append(0)
    for i in range(1,len(text)):
        #i=3
        t=text[i]
        if t=='G':
            skew.append(skew[i]+1)
        elif t=='C':
            skew.append(skew[i]-1)
        else:
            skew.append(skew[i])
    return skew 
    #return ' '.join(str(s) for s in skew)

calcSkew(text)


def minSkew(genome):
    skew_list=calcSkew(genome)
    acum_list=[skew_list[0]]
    pos={}
    min_val=99999999
    for i in range(1,len(skew_list)):
        skew_val=skew_list[i]
        acum_list.append(skew_list[i-1]+skew_val)
        if skew_val<=min_val:
            min_val=skew_val
            pos[i]=min_val
    return [item[0] for item in pos.items() if item[1]==min_val]
                
