def minSkewV2(text):
    min_val=99999999
    acum=0
    pos={}
    for i in range(len(text)):
        t=text[i]
        if t=='G':
            acum+=1
        elif t=='C':
            acum-=1
        
        if acum <= min_val:
            min_val=acum
            pos[i+1]=min_val      
    return [item[0] for item in pos.items() if item[1]==min_val]

