import itertools

def createDictionary(k):
    dic={}
    nucleotides = 'ACGT'
    for perm in itertools.product(nucleotides,repeat=k):
        dic[''.join(perm)]=0
    return dic


def frequentWordsMismatch(text, k, d):
    frequencyArray=createDictionary(k)
    for pattern in frequencyArray.keys():        
        frequencyArray[pattern]=approximatePatternCount(pattern,text,d)   
    max_count=max(frequencyArray.values())
    frequentPatterns = [pattern for pattern in frequencyArray.keys() if frequencyArray[pattern] == max_count]
    return frequentPatterns

