def reverseComplement(pattern):
    dic ={'A':'T','T':'A','C':'G','G':'C'}
    new_pattern=[]
    n=""
    for l in pattern:
        new_pattern.append(dic[l])
        n=n+l
    new_pattern.reverse()
    return ''.join(new_pattern)


def frequentWordsMismatchReverseComplement(text, k, d):
    frequencyArray=createDictionary(k)
    for pattern in frequencyArray.keys():
        rc = reverseComplement(pattern)
        frequencyArray[pattern]=approximatePatternCount(pattern,text,d)+approximatePatternCount(rc,text,d)   
    max_count=max(frequencyArray.values())
    frequentPatterns = [pattern for pattern in frequencyArray.keys() if frequencyArray[pattern] == max_count]
    return frequentPatterns

