def neighbors(pattern, d):
        if d == 0:
            return pattern
        if len(pattern) == 1 :
            return ['A', 'C', 'G', 'T']
        neighborhood = []
        suffixNeighbors = neighbors(pattern[1:], d)
        for text in suffixNeighbors:
            if hammingDistance(pattern[1:], text) < d:
                for x in ['A', 'C', 'G', 'T']:
                    neighborhood.append(x + text) 
            else:
                neighborhood.append(pattern[0] + text)
        return neighborhood
    
